import './App.css';
import HomePage from'./pages/homepage/homepage.component';
import { Switch, Route } from 'react-router-dom';

const HatsPage = ()=>(
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div className="App">
    <Switch>
      <Route exact={true} path='/' component ={HomePage}/>
      <Route exact={true} path='/hats' component ={HatsPage}/>
    </Switch>

    </div>

  );
}

export default App;
